import React, { useState } from 'react';
import InputField from './components/InputField'; 
import InputMaskField from './components/InputMaskField'; 
import './PaginaCadastro.css';

export default function Cadastro() {
  const [formData, setFormData] = useState({
    nomeCompleto: '',
    nomeFantasia: '',
    cpf: '',
    dataNascimento: '',
    documentoExterior: '',
    telefone: '',
    celular: '',
    cidadeNascimento: '',
    inscricaoEstadual: '',
    rg: '',
    cidadeExpedicaoRg: '',
    pisPasep: '',
    email: '',
    nomeMae: '',
    sexo: '',
    estadoCivil: '',
    orgaoExpeditor: '',
    dataEmissaoRg: '',
    rntrc: '',
    validadeRntrc: '',
    codigo: '',
    cep: '',
    logradouro: '',
    numero: '',
    complemento: '',
    bairro: '',
    cidade: '',
    tipoEndereco: '',
    latitude: '',
    longitude: '',
  });

  const [errors, setErrors] = useState({});

  // Função para lidar com as mudanças nos campos
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  // Função para validar o formulário
  const validateForm = () => {
    const newErrors = {};

    // Campos obrigatórios
    const requiredFields = [
      'nomeCompleto',
      'nomeFantasia',
      'cpf',
      'dataNascimento',
      'telefone',
      'celular',
      'cidadeNascimento',
      'inscricaoEstadual',
      'rg',
      'cidadeExpedicaoRg',
      'email',
      'nomeMae',
      'sexo',
      'dataEmissaoRg',
      'cep',
      'logradouro',
      'numero',
      'bairro',
      'cidade',
    ];

    requiredFields.forEach((field) => {
      if (!formData[field]?.trim()) {
        newErrors[field] = 'Este campo é obrigatório';
      }
    });

    return Object.keys(newErrors).length === 0 ? true : newErrors;
  };

  // Função para lidar com o envio do formulário
  const handleSubmit = (e) => {
    e.preventDefault();

    const validation = validateForm();
    
    if (validation === true) {
      console.log('Formulário enviado com sucesso!');
      // Aqui você pode enviar os dados para o backend ou fazer o que for necessário.
    } else {
      setErrors(validation); // Exibir os erros no estado
    }
  };

  return (
    <div className="bg-[#EAF7FF] min-h-screen flex items-center justify-center">
      <div className="form-container container">
        <div className="header">
          <p className="text-[25px] md:text-[45px] font-sans font-bold italic text-white pt-5 md:drop-shadow-[10px_8px_3px_rgba(0,0,0,0.3)]">
            Cadastro
          </p>
        </div>

        <form className="form" onSubmit={handleSubmit}>
          <div className="inputs">
            <InputField
              label="Nome Completo"
              type="text"
              placeholder="Digite o nome completo"
              name="nomeCompleto"
              value={formData.nomeCompleto}
              onChange={handleChange}
              required
            />
            {errors.nomeCompleto && <p className="error">{errors.nomeCompleto}</p>}

            <InputField
              label="Nome Fantasia"
              type="text"
              placeholder="Digite o nome fantasia"
              name="nomeFantasia"
              value={formData.nomeFantasia}
              onChange={handleChange}
              required
            />
            {errors.nomeFantasia && <p className="error">{errors.nomeFantasia}</p>}

            <InputMaskField
              label="CPF"
              mask="000.000.000-00"
              placeholder="Digite o CPF"
              name="cpf"
              value={formData.cpf}
              onChange={handleChange}
              required
            />
            {errors.cpf && <p className="error">{errors.cpf}</p>}

            <InputMaskField
              label="Data de Nascimento"
              mask="00/00/0000"
              placeholder="DD/MM/AAAA"
              name="dataNascimento"
              value={formData.dataNascimento}
              onChange={handleChange}
              required
            />
            {errors.dataNascimento && <p className="error">{errors.dataNascimento}</p>}

            <InputMaskField
              label="Telefone"
              mask="(00) 0000-0000"
              placeholder="Digite o telefone"
              name="telefone"
              value={formData.telefone}
              onChange={handleChange}
              required
            />
            {errors.telefone && <p className="error">{errors.telefone}</p>}

            <InputMaskField
              label="Celular"
              mask="(00) 00000-0000"
              placeholder="Digite o celular"
              name="celular"
              value={formData.celular}
              onChange={handleChange}
              required
            />
            {errors.celular && <p className="error">{errors.celular}</p>}

            <InputField
              label="Cidade de Nascimento"
              type="text"
              placeholder="Digite a cidade onde nasceu"
              name="cidadeNascimento"
              value={formData.cidadeNascimento}
              onChange={handleChange}
              required
            />
            {errors.cidadeNascimento && <p className="error">{errors.cidadeNascimento}</p>}

            <InputField
              label="Inscrição Estadual"
              type="text"
              placeholder="Digite a IE"
              name="inscricaoEstadual"
              value={formData.inscricaoEstadual}
              onChange={handleChange}
              required
            />
            {errors.inscricaoEstadual && <p className="error">{errors.inscricaoEstadual}</p>}

            <InputMaskField
              label="RG"
              mask="00.000.000-0"
              placeholder="Digite o RG"
              name="rg"
              value={formData.rg}
              onChange={handleChange}
              required
            />
            {errors.rg && <p className="error">{errors.rg}</p>}

            <InputField
              label="Cidade Expedição RG"
              type="text"
              placeholder="Digite a cidade de expedição"
              name="cidadeExpedicaoRg"
              value={formData.cidadeExpedicaoRg}
              onChange={handleChange}
              required
            />
            {errors.cidadeExpedicaoRg && <p className="error">{errors.cidadeExpedicaoRg}</p>}

            <InputField
              label="E-mail"
              type="email"
              placeholder="Digite o e-mail"
              name="email"
              value={formData.email}
              onChange={handleChange}
              required
            />
            {errors.email && <p className="error">{errors.email}</p>}

            <InputField
              label="Nome da Mãe"
              type="text"
              placeholder="Digite o nome da mãe"
              name="nomeMae"
              value={formData.nomeMae}
              onChange={handleChange}
              required
            />
            {errors.nomeMae && <p className="error">{errors.nomeMae}</p>}

            <InputField
              label="Sexo"
              type="text"
              placeholder="Masculino / Feminino / Outro"
              name="sexo"
              value={formData.sexo}
              onChange={handleChange}
              required
            />
            {errors.sexo && <p className="error">{errors.sexo}</p>}

            {/* Outros campos podem ser adicionados aqui conforme necessário */}
          </div>

          <div className="submit-container">
            <input type="submit" value="CADASTRAR" className="submit" />
          </div>
        </form>
      </div>
    </div>
  );
}
